import React from "react";
import Layout from "../../components/Layout";
import firebase from "../../sideEffects/firebase";

const propTypes = {};

const defaultProps = {};

const getInitialProps = async () => {
  const meetings = await firebase
    .firestore()
    .collection("meetings")
    .get()
    .then(snap => snap.forEach(doc => doc.data()))
    .catch(error => error);

  return { meetings };
};

export default function index({ url, meetings }) {
  // {url.query.slug}
  console.log({ meetings });
  return (
    <Layout>
      <h1 className="f1 tc">Pick a time...</h1>
      <section className="flex items-center justify-center">
        <article className="mw5 center bg-white br3 pa3 pa4-ns mv3 ba b--black-10 pointer grow">
          <div className="tc">
            <h1 className="f4">Mimi Whitehouse</h1>
            <hr className="mw3 bb bw1 b--black-10" />
          </div>
          <p className="lh-copy measure center f6 black-70">
            Quite affectionate and outgoing. She loves to get chin scratches and
            will roll around on the floor waiting for you give her more of them.
          </p>
        </article>
      </section>
    </Layout>
  );
}

index.propTypes = propTypes;
index.defaultProps = defaultProps;
index.getInitialProps = async () => {
  const meetings = await firebase
    .firestore()
    .collection("meetings")
    .get()
    .then(snap => snap.forEach(doc => doc.data()))
    .catch(error => error);

  return { meetings };
};
